import './App.css'

function List(props) {
  return (
    <ul>
      {props.animalss.map((animal) => {
        return animal.startsWith('L') ? <li key={animal}>{animal}</li> : null
      })}
    </ul>
  )
}

function App() {
  const animals = ['Lion', 'Cow', 'Snake', 'Lizard']

  return (
    <div>
      <h1>Animals: </h1>
      <List animalss={animals} />
    </div>
  )
}

export default App
